Hi, I‚Äôm looking for using the VPI Optical Flow LK Tracker. I looked at the example on the site and I have some questions.
Beforehand I‚Äôll specify that what I need is that the tracker will work asynchronously and without needing to download/upload data on the GPU. I‚Äôm working on a Linux 22 environment.Thanks.Update: I‚Äôm trying to wrap a cv::cuda::GpuMat with a VPIArray, but I keep getting an invalid argument error on vpiArrayCreateWrapper:VPIArray VpiLKTrackerGPU::CreateVpiArrayViewer(cv::cuda::GpuMat &mat) {
VPIArray vpiArray;
VPIArrayData vpiArrayData;
vpiArrayData.bufferType = VPI_ARRAY_BUFFER_CUDA_AOS;
vpiArrayData.buffer.aos.data = mat.cudaPtr();
switch (mat.type()) {
case CV_32FC2:
vpiArrayData.buffer.aos.type = VPI_ARRAY_TYPE_KEYPOINT_F32;
vpiArrayData.buffer.aos.strideBytes = sizeof(cv::Vec2f);
break;
case CV_8UC1:
vpiArrayData.buffer.aos.type = VPI_ARRAY_TYPE_U8;
vpiArrayData.buffer.aos.strideBytes = 1;
break;
default: throw std::invalid_argument();
}
vpiArrayData.buffer.aos.capacity = mat.rows;
vpiArrayData.buffer.aos.sizePointer = &mat.rows;}Now, the documentation for vpiArrayCreateWrapper itself is confusing as it lists VPI_ARRAY_BUFFER_CUDA_AOS as a legitimate type but the documentation itself specifies wrapping host memory, and running the code with regular cv::Mat works. The question is whether is that I‚Äôm missing something and if I‚Äôm not whether is it possible to make a VPIArray wrapper to device memory.Powered by Discourse, best viewed with JavaScript enabled

