Hi,
I have recently start using cudf for parsing csv file in c++. I‚Äôm able to build an example and get some info about the loaded data. However, I would like to specify data type for each column then extract the value at each index (i‚Ä¶n, j‚Ä¶m).Thanks,
DomMost RAPIDS requests are in python but the C++ interface is the Python impl foundation. This sample code is meant to be building blocks for your code already presented and it use generic auto data typing to skip past impl details of varing column data types. Being that your question was mainly about setting column dtypes, please look over this Issue which lists all the possible types, https://github.com/rapidsai/cudf/issues/1119 . For character strings see this more detailed developers guide for libcudf and string_scalar topic https://docs.rapids.ai/api/libcudf/stable/developer_guide | Use traits to set gdf_data elements and other typedefs ¬∑ Issue #1119 ¬∑ rapidsai/cudfOnce #892 is merged and after we move away from cffi in #599 , update the union gdf_data to use traits defined members. The code to be changed: typedef union { int8_t si08; /**< GDF_INT8 */ int16_t‚Ä¶github.com |#include <cudf/io/functions.hpp>
#include <cudf/io/csv.hpp>
#include <cudf/column/column_factories.hpp>
#include <cudf/types.hpp>std::unordered_map<std::string, std::vector<gdf_scalar>> read_csv_with_types(const std::string& filename, const std::unordered_map<std::string, gdf_dtype>& column_types)
{
// Create an empty unordered map to store the extracted data
std::unordered_map<std::string, std::vector<gdf_scalar>> data;// Read the CSV file using cuDF
cudf::io::csv_reader_options options = cudf::io::csv_reader_options::builder(cudf::io::source_info{filename});
for (const auto& column_type : column_types)
{
options.set_dtypes({column_type.first}, {column_type.second});
}
auto result = cudf::io::read_csv(options);// Iterate over each column in the result table
auto table = result.tbl;
for (cudf::size_type i = 0; i < table.num_columns(); ++i)
{
const auto& column = table.get_column(i);
const auto& column_name = column->name();
const auto& column_data = static_cast<const cudf::column_view&>(*column).begin<gdf_scalar>();// Store the column data in the unordered map
data[column_name] = std::vector<gdf_scalar>(column_data, column_data + column->size());
}return data;
}int main()
{
// Specify the filename of the CSV file
std::string filename = ‚Äúyour_file.csv‚Äù;// Specify the data types of each column
std::unordered_map<std::string, gdf_dtype> column_types;
column_types[‚Äúcolumn1‚Äù] = GDF_INT32;
column_types[‚Äúcolumn2‚Äù] = GDF_FLOAT64;
column_types[‚Äúcolumn3‚Äù] = GDF_STRING;// Call the CSV file reader function
std::unordered_map<std::string, std::vector<gdf_scalar>> data = read_csv_with_types(filename, column_types);// Access the extracted data
for (const auto& column_data : data)
{
const std::string& column_name = column_data.first;
const std::vector<gdf_scalar>& column_values = column_data.second;std::cout << ‚ÄúColumn '‚Äù << column_name << ‚Äú‚Äô data:‚Äù << std::endl;
for (const auto& scalar : column_values)
{
// Access scalar value using scalar.is_valid and scalar.data
// ‚Ä¶
}
}return 0;
}Hi @bfurtaw,It looks like the gdf_data is not available in latest libcudf. However have done similar implementation using cudf::data_type but it gives segmentation fault when casting column value. Below code snippetSolved by copying data to host_vectorThis topic was automatically closed 14 days after the last reply. New replies are no longer allowed.Powered by Discourse, best viewed with JavaScript enabled

I have a running program, that usually works fine.  But sometimes after restarting it fails with logs below:terminate called after throwing an instance of ‚Äòchar const*‚Äô
ERROR: INVALID_CONFIG: Deserialize the cuda engine failed.
ERROR: INVALID_STATE: std::exception
ERROR: ‚Ä¶/rtSafe/coreReadArchive.cpp (63) - Serialization Error in verifyHeader: 0 (CRC-32 checksum does not match value in archive).Then it can start again, without any issues. This happens not so often. From logs I see, that it happens in one of the functions below. In the first function I write an engine to a file, and in the second function I read it and use it further. What can cause this problem?1 - function
void serializeEngine(ICudaEngine* engine, const string& engineFilename) {
ofstream engineFile(engineFilename, ios::binary);
unique_ptr<IHostMemory, TensorRtDeleter> trtModelStream{engine->serialize(), TensorRtDeleter()};
engineFile.write((char*) trtModelStream->data(), trtModelStream->size());
if (engineFile.bad())
cerr << ‚ÄúChar_const. SerializeEngine: I/O error while write‚Äù << endl;
else if (engineFile.eof())
cerr << ‚ÄúChar_const. SerializeEngine: End of file reached successfully‚Äù << endl;
else if (engineFile.fail())
cerr << ‚ÄúChar_const. SerializeEngine: Non-integer data encountered‚Äù << endl;
else
cout << ‚ÄúChar_const. SerializeEngine: ‚Äú<< trtModelStream->size() <<‚Äù bytes were written to enginefile‚Äù << endl;
}2 - function
ICudaEngine* readEngine(const string& engineFilename) {
ifstream engineFile(engineFilename);}TensorRT Version: 6.0.1.5
